import logo from "./logo.svg";
import "./App.css";
import "./index.css";
import { ReactDOM } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import MainPage from "./Pages/MainPage";
import Login from "./Pages/Login";

function App() {
    return (
        <div className="App">
            {/* <MainPage /> */}
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={MainPage} />
                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default App;
